import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [posts, setPosts] = useState([]);
  const [products, setProducts] = useState([]);

  useEffect(() => {
    //fetch product data from express server
    axios
      .get(`http://localhost:5000/products`)
      .then((response) => {
        setProducts(response.data);
        console.log(products);
    })
    .catch((error) => {
      console.log('Error getting product data from server')
    });

    //fetch post data from express server
    axios
      .get(`http://localhost:5000/posts`)
      .then((response) => {
        setPosts(response.data);
        console.log(posts);
    })
    .catch((error) => {
      console.log('Error getting post data from server.')
    }
  )}, []);

  return (
    <div>
      <h1>Product Showcase Website</h1>
      <ul>
        {products.map((product) => {
          <li key={product._id}>
            {product.name}
            {product.description}
            {product.features}
            {product.downloadURL}
          </li>
        })}
      </ul>
    </div>
  )
}

export default App;
